import React from 'react';
import '../../../../App.css';

const hour = (props) => {
    let imgSrc = props.setImg(props.weather);
        return (
            <div className="cardCustom hourCard">
                <p className="hour">{props.hour}</p>
                <div className="d-flex justify-content-around">
                    <p className="temperature align-self-center">{props.temperature}<sup>C</sup></p>
                    <img src={imgSrc} alt={props.weather} className="images"/>             
                    <div className="information justify-content-center">
                        <p>Brzina vjetra</p>
                        <p>{props.windSpeed}km/h</p>
                    </div>
                    <div className="information">
                        <p>Mogućnost padavina</p>
                        <p>{props.chanceOfRain}%</p>
                    </div>
                    <div className="information">
                        <p>Vlažnost vazduha</p>
                        <p>{props.humidity}%</p>
                    </div>
                </div>
                </div>
        );
}

export default hour;
